import React from "react";
import styled from "styled-components";
import TemplateOne from "../Templates/TemplateOne";
import TemplateTwo from "../Templates/TemplateTwo";

const Home = () => {
    return (
        <HomeWrapper>
            <TemplateOne />
            <TemplateTwo />
        </HomeWrapper>
    );
};

const HomeWrapper = styled.section`
    margin-top: 4rem;
    width: 100%;
`;

export default Home;
